  false,\n\t\"url\": null,\n\t\"notes\": \"The Ocean Uses Atlas Project is an innovative
  partnership between the Coastal Response Research Center (CRRC) and NOAA's Office
  of Ocean and Coastal Resource Management (OCRM). The Project was designed to enhance
  ocean management through geospatial data on the full range of significant human
  uses of the ocean environment from the shorelines of New Hampshire and Southern
  Maine to the EEZ boundary. The data were gathered from regional ocean experts and
  users through participatory GIS methods. For more information on the project scope,
  background and related data products, please visit http://www.crrc.unh.edu/workshops/ocean_uses/index.html
  or http://www.mpa.gov/dataanalysis/atlas_nhsm/.\",\n\t\"license_title\": null,\n\t\"extras\":
